define('text!Home/home.html', ['module'], function(module) { module.exports = "<template>\n<div class=\"row\">\n <div class=\"col-md-4 panel\" style=\"height:300px;\" repeat.for=\"bill of bills\" >\n        <div class=\"col-md-12\">${bill.id}</div>\n        <div class=\"col-md-12\">${bill.title}</div>\n        <div class=\"col-md-12\">${bill.updated_at}</div>\n\n        <input type=\"text-area\" value.bind=\"bill.comment\"/>\n        <button click.delegate=\"postComment(bill, bill.comment)\">Click Me</button>\n            <ul>\n                <li repeat.for=\"comment of bill.comments\">\n                    ${comment}\n                </li>\n                </ul>\n    </div>\n</div>\n   \n\n</template>"; });
